import { BrowserRouter as Router, Routes, Route, Link } from 'react-router-dom';
import VideoEditorApp from './pages/VideoEditorAppPage';
import TermsOfUsePage from './pages/TermsOfUsePage';
import PrivacyPolicyPage from './pages/PrivacyPolicyPage';

function App() {
  return (
    <Router>
      <div className="App">
        <Routes>
          <Route path="/" element={<VideoEditorApp />} />

          <Route path="/terms-of-use" element={<TermsOfUsePage />} />

          <Route path="/confidentiality" element={<PrivacyPolicyPage />} />


          <Route path="*" element={<NotFoundPage />} />
        </Routes>
      </div>
    </Router>
  );
}

// Простая 404 страница
const NotFoundPage = () => {
  return (
    <div className="min-h-screen bg-gradient-to-br from-slate-50 via-blue-50 to-indigo-50 flex items-center justify-center">
      <div className="text-center">
        <h1 className="text-6xl font-bold text-slate-300 mb-4">404</h1>
        <h2 className="text-2xl font-semibold text-gray-800 mb-4">Страница не найдена</h2>
        <p className="text-gray-600 mb-8">Запрашиваемая страница не существует</p>
        <Link 
          to="/" 
          className="inline-flex items-center px-6 py-3 bg-gradient-to-r from-slate-600 to-blue-600 hover:from-slate-700 hover:to-blue-700 text-white rounded-xl transition-all duration-300 shadow-lg hover:shadow-xl font-semibold"
        >
          Вернуться на главную
        </Link>
      </div>
    </div>
  );
};

export default App;
